TEST(StaticFactory, dangerDelegateCall)
{
  bytes bin = fromHex("");
  StaticFactory staticFactory;
  auto ret = staticFactory.analyze(bin);
  EXPECT_GT(ret.dangerDelegateCall, 0);
}

